               IF(e.lab_order_code IS NOT NULL, '1', '0')  AS has_sexual_activity_labs,
               IF(e.procedure_code IS NOT NULL, '1', '0')  AS has_sexual_activity_procedures,
               IF(EXISTS(
                          SELECT *
                          FROM patient_orders AS o
                                   INNER JOIN patient_order_results AS r
                                              ON o.pid = r.pid
                                                  AND o.id = r.order_id
                          WHERE o.eid = e.eid
                            AND o.pid = e.pid
                            AND o.code IN ('14463-4', '14464-2', '14467-5', '14474-1', '14513-6', '16600-9',
