    CREATE TEMPORARY TABLE report_denominator_ds
    SELECT 1 as `value`, pid
    FROM report_ds
    WHERE age BETWEEN 16 AND 20
      AND (has_sexual_activity_dx = '1'
        OR was_prescribed_or_active_contraceptives = '1'
        OR has_sexual_activity_labs = '1'
        OR has_sexual_activity_procedures = '1')
    GROUP BY pid;

    CREATE TEMPORARY TABLE report_numerator_ds
    SELECT 1 as `value`, pid
    FROM report_ds
    WHERE age BETWEEN 16 AND 20
      AND (has_sexual_activity_dx = '1' OR was_prescribed_or_active_contraceptives = '1' OR
           has_sexual_activity_labs = '1' OR has_sexual_activity_procedures = '1')
      AND has_chlamydia_screening = '1'
    GROUP BY pid;

    SET @denominator = (SELECT sum(`value`) FROM report_denominator_ds);
    SET @numerator = (SELECT sum(`value`) FROM report_numerator_ds);
    SET @denominator_pids = (SELECT group_concat(pid) FROM (SELECT pid FROM report_denominator_ds GROUP BY pid) as d);
    SET @numerator_pids = (SELECT group_concat(pid) FROM (SELECT pid FROM report_numerator_ds GROUP BY pid) as n);


    CREATE TEMPORARY TABLE report_denominator_ds_1
    SELECT 1 as `value`, pid
    FROM report_ds
    WHERE age BETWEEN 21 AND 24
      AND (has_sexual_activity_dx = '1'
        OR was_prescribed_or_active_contraceptives = '1'
        OR has_sexual_activity_labs = '1'
        OR has_sexual_activity_procedures = '1')
    GROUP BY pid;

    CREATE TEMPORARY TABLE report_numerator_ds_1
    SELECT 1 as `value`, pid
    FROM report_ds
    WHERE age BETWEEN 21 AND 24
      AND (has_sexual_activity_dx = '1' OR was_prescribed_or_active_contraceptives = '1' OR
           has_sexual_activity_labs = '1' OR has_sexual_activity_procedures = '1')
      AND has_chlamydia_screening = '1'
    GROUP BY pid;

    SET @denominator_1 = (SELECT sum(`value`) FROM report_denominator_ds_1);
    SET @numerator_1 = (SELECT sum(`value`) FROM report_numerator_ds_1);
    SET @denominator_pids_1 =
            (SELECT group_concat(pid) FROM (SELECT pid FROM report_denominator_ds_1 GROUP BY pid) as d);
    SET @numerator_pids_1 = (SELECT group_concat(pid) FROM (SELECT pid FROM report_numerator_ds_1 GROUP BY pid) as n);

    SELECT *
    FROM (
             (SELECT @provider            as provider,
                     @insurance           as insurance,
                     'MIPS - AGE (16-20)' as title,
                     @denominator         as denominator,
                     @denominator_pids    as denominator_pids,
                     @numerator           as numerator,
                     @numerator_pids      as numerator_pids)
             UNION ALL
             (SELECT @provider            as provider,
                     @insurance           as insurance,
                     'MIPS - AGE (21-24)' as title,
                     @denominator_1       as denominator,
                     @denominator_pids_1  as denominator_pids,
                     @numerator_1         as numerator,
                     @numerator_pids_1    as numerator_pids)) AS r;

END$$

